import ApexCharts from 'react-apexcharts'
import React from 'react'
import { useQuery } from "react-query"
import { fetchStockHistory } from '../api'

interface IHistorical {
    time_open: string;
    time_close: string;
    open: number;
    high: number;
    low: number;
    close: number;
    volume: number;
    market_cap: number;
  }
interface IChart {
    stockId: string;
}

function Chart({ stockId }: IChart) {
    const { isLoading, data } = useQuery<IHistorical>(["history", stockId], ()=> fetchStockHistory(stockId))
    return (
        <div>
            Chart
        </div>
    )
}

export default Chart
